import React from "react";
import './Navbar.css'
import { Link } from "react-router-dom";

const Navbar = () => {
  const navStyle = {
    color: 'white'
  }

  return (
    <div>
      <nav>

        <h3>Wild Circus. </h3>
        <ul className="nav-links my-auto">
        <Link style={navStyle} to="/">
            <li className='liLinks'>Home</li>
          </Link>

          <Link style={navStyle} to="/history">
            <li className='liLinks'>History</li>
          </Link>

          <Link style={navStyle} to='/contact'>
            <li className='liLinks'>Contact</li>
          </Link>

          <Link style={navStyle} to='/shop'>
            <li className='liLinks'>Shop</li>
          </Link>
        </ul>
      </nav>
    </div>
  );
};

export default Navbar;
